import React from 'react'
import {connect} from 'react-redux'
import {logOutAction} from '../../actions'


class Logout extends React.Component {

  render () {
    return (
      <div>
        <h2>Logout</h2>
        //{this.props.logOutAction()}
      </div>
    )
  }
}

export default connect(null,{logOutAction})(Logout)
